UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'GDMA' THEN 2.346 WHEN 'MMIN' THEN 0.304 WHEN 'GOEX' THEN 0.944 WHEN 'IJK' THEN 0.703 WHEN 'VDC' THEN 5.234 WHEN 'SRET' THEN 0.576 WHEN 'JPEM' THEN 2.892 WHEN 'SOCL' THEN 0.472 WHEN 'SPBO' THEN 0.5 WHEN 'FXZ' THEN 1.0450000000000002 WHEN 'SOXQ' THEN 0.28 WHEN 'ARGT' THEN 1.984 WHEN 'TMSL' THEN 0.237 WHEN 'DDM' THEN 0.9490000000000001 WHEN 'LCTD' THEN 3.253 WHEN 'SHYD' THEN 0.259 WHEN 'VEA' THEN 1.54 WHEN 'BYLD' THEN 0.399 WHEN 'PSI' THEN 0.083 WHEN 'TDSB' THEN 0.6799999999999999
    END,
    updatedat = NOW()
    WHERE symbol IN ('GDMA', 'MMIN', 'GOEX', 'IJK', 'VDC', 'SRET', 'JPEM', 'SOCL', 'SPBO', 'FXZ', 'SOXQ', 'ARGT', 'TMSL', 'DDM', 'LCTD', 'SHYD', 'VEA', 'BYLD', 'PSI', 'TDSB');